package rpc;

message LogData
{
	required int32 serverID = 1;
	required int32 accountID = 2;
	optional string accountName = 3[default=""];
	optional string parentOpenId = 4[default=""];
	optional int32 level = 6[default=-1];
	required int32 logType = 7;
	optional int32 reason = 8[default=-1];
	optional int64 param1 = 9[default=-1];
	optional int64 param2 = 10[default=-1];
	optional int64 param3 = 11[default=-1];
	optional int64 param4 = 12[default=-1];
	optional int64 param5 = 13[default=-1];
	optional int64 param6 = 14[default=-1];
	optional int64 param7 = 15[default=-1];
	optional int64 param8 = 16[default=-1];
	optional string paramStr1 = 17[default=""];
	optional string paramStr2 = 18[default=""];
	optional string paramStr3 = 19[default=""];
	optional string paramStr4 = 20[default=""];
	optional string paramStr5 = 21[default=""];
	optional string paramStr6 = 22[default=""];
	optional string paramStr7 = 23[default=""];
	optional string paramStr8 = 24[default=""];
}

message S2L_LogMessage
{
	repeated LogData data = 1;
};

message L2S_Register
{
	required int32 LogProxyId = 1;
	required int32 servicePort = 2;
	optional string ip = 3;
}
